import {useState} from 'react'
import { Cookies, useCookies } from 'react-cookie'
import {useNavigate} from 'react-router-dom'
import axios from 'axios'
import React from 'react'
import Nav from '../components/Navigation/Nav'

const OnBoarding = () => {

    // The code defines a state variable for a user's data, including their id, first name, date of birth, PhotoUrl, 
    // and a list of userMatches. It also defines functions for setting and removing cookies.
    const [cookies, setCookie, removeCookie] = useCookies(null)
    const [DataOfTheUser, setDataOfUser] = useState({
        user_id: cookies.UserId,
        First_Name: "",
        DayOfBirth: "",
        MonthOfBirth: "",
        YearOfBirth: "",
        PhotoUrl: "",
        aboutUser: "",
        userMatches: []
    })


    // The code below submits a form to a server. It uses the useNavigate hook from React Router to navigate to the 
    // '/dashboard' route if the form is submitted successfully.
    let navigate = useNavigate()

    const handleSubmit = async (e) => {
        console.log('submitted')
        e.preventDefault()
        try {
            const response = await axios.put('http://localhost:8888/user', {DataOfTheUser})
            console.log(response)
            const success = response.status === 200
            if (success) navigate('/dashboard')
        } catch (err) {
            console.log(err)
        }

    }

    // The code below sets up a handleChange function to be used on a form. It uses a ternary operator to check the type of input, 
    // whether it is a checkbox or not. If it is a checkbox, it returns the inputValue as checked, if not, it returns the inputValue as is. 
    // It then sets the name of the input to whatever was entered into the form.
    const handleChange = (e) => {
        console.log('e', e)
        const inputValue = e.target.type === "checkbox" ? e.target.checked : e.target.inputValue
        const name = e.target.name

        setDataOfUser((prevState) => ({
            ...prevState,
            [name]: inputValue
        }))
    }


    // The code above renders a form for a user to fill out to create an account. The form includes input fields for the user's 
    // first name, birthday, gender, gender preference, and a short description aboutUser themselves. There is also an input field for 
    // the user to submit a PhotoUrl for a profile photo.
    return (
        <>
            <Nav
                setShowPopup={() => {
                }}
                showPopup={false}
            />

            <div className="verification">
                <h2>CREATE ACCOUNT</h2>

                <form onSubmit={handleSubmit}>
                    <section>
                        <label htmlFor="First_Name">First Name</label>
                        <input
                            id="First_Name"
                            type='text'
                            name="First_Name"
                            placeholder="First Name"
                            required={true}
                            inputValue={DataOfTheUser.First_Name}
                            onChange={handleChange}
                        />

                        <label>Birthday</label>
                        <div className="multiple_container">
                            <input
                                id="DayOfBirth"
                                type="number"
                                name="DayOfBirth"
                                placeholder="Day"
                                required={true}
                                inputValue={DataOfTheUser.DayOfBirth}
                                onChange={handleChange}
                            />

                            <input
                                id="MonthOfBirth"
                                type="number"
                                name="MonthOfBirth"
                                placeholder="Month"
                                required={true}
                                inputValue={DataOfTheUser.MonthOfBirth}
                                onChange={handleChange}
                            />

                            <input
                                id="YearOfBirth"
                                type="number"
                                name="YearOfBirth"
                                placeholder="Year"
                                required={true}
                                inputValue={DataOfTheUser.YearOfBirth}
                                onChange={handleChange}
                            />
                        </div>

                        <label>What is the gender of your animal?</label>
                        <div className="multiple_container">
                            <input
                                id="boy_gender"
                                type="radio"
                                name="gender_decision"
                                inputValue="Male"
                                onChange={handleChange}
                                checked={DataOfTheUser.gender_decision === "Male"}
                            />
                            <label htmlFor="boy_gender">Male</label>
                            <input
                                id="girl_gender"
                                type="radio"
                                name="gender_decision"
                                inputValue="Female"
                                onChange={handleChange}
                                checked={DataOfTheUser.gender_decision === "Female"}
                            />
                            <label htmlFor="girl_gender">Female</label>
                        </div>


                        <label>What gender would you like to adopt?</label>

                        <div className="multiple_container">
                            <input
                                id="man-gender-interest"
                                type="radio"
                                name="gender_interest"
                                inputValue="man"
                                onChange={handleChange}
                                checked={DataOfTheUser.gender_interest === "Male"}
                            />
                            <label htmlFor="man-gender-interest">Boys</label>
                            <input
                                id="woman-gender-interest"
                                type="radio"
                                name="gender_interest"
                                inputValue="woman"
                                onChange={handleChange}
                                checked={DataOfTheUser.gender_interest === "Female"}
                            />
                            <label htmlFor="woman-gender-interest">Girls</label>
                        </div>

                        <label htmlFor="aboutUser">aboutUser</label>
                        <input
                            id="aboutUser"
                            type="text"
                            name="aboutUser"
                            required={true}
                            placeholder="Help me find my furever home..."
                            inputValue={DataOfTheUser.aboutUser}
                            onChange={handleChange}
                        />

                        <input type="submit"/>
                    </section>

                    <section>

                        <label htmlFor="PhotoUrl">Profile Photo</label>
                        <input
                            type="PhotoUrl"
                            name="PhotoUrl"
                            id="PhotoUrl"
                            onChange={handleChange}
                            required={true}
                        />
                        <div className="photo-container">
                            {DataOfTheUser.PhotoUrl && <img src={DataOfTheUser.PhotoUrl} alt="profile pic preview"/>}
                        </div>


                    </section>

                </form>
            </div>
        </>
    )
}
export default OnBoarding
